(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[11],{314:function(e){e.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"O feed de [symbol] tem um atraso de [delay] minutos","[symbol] market is now opened.":"O mercado de [symbol] está agora aberto.","[symbol] market is presently closed.":"O mercado de [symbol] está atualmente fechado.","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"Um indicador de impulso técnico que compara o preço de fechamento de um título ao seu intervalo de preços durante um determinado período de tempo. A sensibilidade do oscilador aos movimentos do mercado pode ser reduzida ao ajustar o período de tempo ou ao assumir a média móvel do resultado.","Active":"Ativo","Add":"Adicionar","Add new template":"Adicionar novo modelo","Add new templates":"Adicionar novo modelo","All drawings":"Todos os desenhos","already exists.":"já existe.","Area":"Area","Available only for \\\\\\"Area\\\\\\" chart type.":"Disponível apenas para o tipo de gráfico \\\\\\"Area\\\\\\".","Available only for non-tick time intervals.":"Disponível apenas para intervalos de tempo sem tique taque.","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"Bill Williams introduziu o indicador Alligator em 1995. O Alligator é tanto uma metáfora quanto um indicador. Consiste em três linhas, sobrepostas em um gráfico de preços, que representam a mandíbula, os dentes e os lábios da fera, e foi criado para ajudar o trader a confirmar a presença de uma tendência e sua direção. O indicador Alligator também pode ajudar os traders a designar formações de onda corretivas e de impulso, mas a ferramenta funciona melhor quando combinada com um indicador de momentum.","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"Bandas de Bollinger podem ser usadas para medir a alta o a baixa do preço relativo a negociações anteriores.","Box Size":"Tamanho da caixa","Cancel":"Cancelar","Candle":"Vela","Channel [num]":"Canal [num]","Chart data is not available for this symbol.":"Dados de gráficos não estão disponíveis para este símbolo.","Chart types":"Tipos de gráficos","Charts":"Gráficos","Clear all":"Limpar Todos","CLOSED":"FECHADO","Color":"Cor","Continuous":"Contínuo","Continuous [num]":"Contínuos [num]","CSV":"CSV","Dark":"Escuro","day":"dia","days":"dias","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"Desenvolvido por Larry Williams, o Williams %R é um indicador de impulso que é o inverso do Oscilador Estocástico Rápido. Também conhecido como %R, o Williams %R reflete o nível do fechamento em relativamente à alta mais alto do período de retrospeção.","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"Desenvolvido em 1995 por Tushar Chande, Aroon é um sistema de indicação que determina se uma ação tem alguma tendência ou não, e o nível dessa tendência. Há dois indicadores separados: Aroon para cima e Aroon para baixo. Um Aroon de 25 dias mede o número de dias desde uma alta de 25 dias. Um Aroon para baixo de 25 dias mede o número de dias desde uma baixa de 25 dias.","Display data for a specific date and time":"Exibir dados para uma data e hora específicas","Display remaining time for each interval":"Exibir o tempo restante para cada intervalo","Display the highest and lowest spot price":"Exibir o preço mais alto e mais baixo","Done":"Concluído","Download":"Baixar","Drawing tools":"Ferramentas de desenho","Favorites":"Favoritos","Fib Fan [num]":"Fib Fan [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Fractais são indicadores em gráficos de velas que identificam pontos de inversão no mercado. Os negociadores usam muitas vezes fractais a fim de ter uma ideia sobre a direção em que o preço irá se desenvolver. Um fractal irá se formar quando um determinado padrão de preço ocorrer num gráfico.","H":"H","Highest and lowest spot":"Ponto mais alto e mais baixo","Historical data mode":"Modo de dados históricos","Hollow":"Vazio","Horizontal [num]":"Horizontal [num]","hour":"hora","hours":"horas","Indicators":"Indicadores","Interval duration":"Duração do intervalo","Kagi":"Kagi","L":"L","Language":"Idioma","Last digits stats for latest 1000 ticks on":"Estatísticas do último dígito dos últimos 1000 ticks de","Light":"Claro","Line [num]":"Line [num]","Line Break":"Quebra de linha","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"A MACD é um indicador de negociação usada na análise técnica de preços de ações. É suposto revelar alterações na força, direção, impulso e duração de uma tendência do preço das ações.","Markets":"Mercados","minute":"minuto","minutes":"minutos","Momentum":"","Moving averages":"","Network status":"Status da rede","No results for":"Nenhum resultado para","OHLC":"OHLC","Opens in:":"Abre a porta:","Others":"","Overwrite":"Substituir","Platform settings":"Configurações da plataforma","PNG":"PNG","Point & Figure":"Point & Figure","Price Lines":"Linhas de preço","Range":"Intervalo","Range Bars":"Barras de intervalo","Ray [num]":"Ray [num]","Rectangle [num]":"Retângulo [num]","Renko":"Renko","Reset":"Resetar","Result":"Resultado","Retrieving Chart Data...":"Carregando dados do gráfico...","Retrieving Chart Engine...":"Carregando o motor do gráfico...","Retrieving Market Symbols...":"Carregando símbolos do mercado...","Retrieving Trading Times...":"Carregando horas de negociação...","Reversal":"Inversão","Reversal Percentage":"Percentual de reversão","Right click to delete":"Botão direito do mouse para apagar","Right click to manage":"Botão direito do mouse para gerenciar","Saved templates":"Modelos salvos","Search...":"Pesquisar...","Select language":"Selecione o idioma","Select theme":"Selecionar tema","Settings":"Configurações","Size":"Tamanho","Streaming for [symbol] is not available due to license restrictions":"Transmissão ao vivo do [symbol] não está disponível devido a restrições de licença","Templates":"Modelos","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"O Índice de Movimento Direcional Médio (IMD) foi desenvolvido em 1978 por J. Welles Wilder como um indicador de força de tendência numa série preços de um instrumento financeiro. O IMD varia entre 0 e 100. Geralmente, as leituras de IMD abaixo de 20 indica uma tendência fraca, enquanto leituras acima de 40 indica uma tendência forte.","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"O Awesome Oscillator é um indicador usado para medir o impulso do mercado. O AO calcula a diferença de Médias Móveis Simples de 34 períodos e 5 períodos. As Médias Móveis Simples que são usadas não são calculadas usando um preço de fechamento, mas sim os pontos médios de cada barra. O AO é geralmente usado para afirmar tendências ou antecipar possível inversões.","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"O Commodity Channel Index (CCI) é um indicador versátil que pode ser usado para identificar uma nova tendência ou avisar de condições extremas.","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"O Oscilador de Preço Detrended (DPO) ajuda a identificar os ciclos de preços sem a influência das tendências de curto e longo prazo. O DPO compara uma média móvel simples a um preço histórico próximo ao meio de um período especificado. Ele também mostra os picos e quedas durante aquele período específico, tornando mais fácil prever os pontos de compra.","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"O canal Donchian é um indicador usado nas negociações do mercado desenvolvido por Richard Donchian. É formado ao pegar na maior alta e na menor baixa dos últimos n períodos. A área entre a alta e a baia é o canal do período escolhido.","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"O Oscilador Gator ajuda a detectar mudanças de tendência no preço de mercado. Com base no indicador Alligator, o Gator plota 2 histogramas em cada lado da linha zero. A fase de sono (ausência de tendência) é quando as barras de ambos os lados ficam vermelhas. A fase de despertar (formação de uma tendência) é quando existem barras vermelhas e verdes em ambos os lados. Quando existem barras verdes em ambos os lados, indica a fase de alimentação (fortalecimento da tendência). Uma barra vermelha solitária aparecendo após a fase de alimentação indica o início da fase saciada (tendência se aproximando do fim).","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"A Nuvem Ichimoku, também conhecida como Ichimoku Kinko Hyo, é um indicador versátil que define suporte e resistência, identifica a direção da tendência, mede o momentum e fornece sinais de negociação. Ichimoku Kinko Hyo se traduz em “gráfico de equilíbrio de um olhar”.","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"A Média Móvel (MA) ajuda a identificar a tendência geral do mercado, filtrando as flutuações de preço de curto prazo. Usando dados históricos, ele calcula o preço médio em um período específico e traça uma linha no gráfico. Se a linha MA se move para cima, é um indicador de uma tendência de alta, uma tendência de baixa se ela se move para baixo. Um sinal de compra ocorre quando o preço se move acima da linha MA.","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"O Envelope Média Móvel (MAE) ajuda a identificar um forte movimento de preço que indica o início de uma tendência. O MAE cria uma linha de média móvel e também 2 bandas ao seu redor. Em teoria, quando o preço de mercado toca as bandas superior ou inferior, ocorre uma reversão da tendência, indicando um sinal de compra.","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"O SAR parabólico é calculado independentemente para cada tendência no preço. Quando o preço está numa tendência de alta, o SAR emerge abaixo do preço e converge para cima em direção ao mesmo. Similarmente, numa tendência de baixa, o SAR emerge acima do preço e converge para baixo. Em cada etapa durante uma tendência, o SAR é calculado com um período de antecedência.","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"O indicador da Taxa de Mudança do Preço (ROC) exibe a diferença entre o preço atual e o preço há x períodos atrás. A diferença pode ser exibida e pontos ou como uma percentagem.","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"A Média Móvel do Arco-íris (RMA) exibe várias linhas de média móvel simultaneamente. Quando as linhas se cruzam, é um indicador de reversão de preço e o ângulo das linhas é útil para prever a força da tendência. Quanto mais íngreme a curva, mais forte é a tendência. Quando o preço cruza as linhas de média móvel de baixo para cima, ele sinaliza uma tendência de alta. Quando o preço cruza as linhas de média móvel de cima, ele sinaliza uma tendência de queda. O RMA é mais fácil de usar em comparação com o uso de vários indicadores de média móvel diferentes ao mesmo tempo.","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"O Índice de Força Relativa (IFR) foi publicado por J. Welles Wilder. O preço atual é normalizado como uma percentagem entre 0 e 100. O nome deste oscilador é enganoso porque ele não compara o instrumento relativo a um outro instrumento ou conjunto de instrumentos, mas sim representa o preço atual relativo a outros preços recentes dentro do período retrospetivo selecionado.","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"O Índice de Momentum Estocástico (SMI) ajuda a identificar as condições de sobrecompra ou sobrevenda no mercado e a prever tendências de baixa ou alta. Ele calcula a distância entre o preço de fechamento atual e a mediana da faixa alta/baixa e exibe 2 linhas no gráfico: a primeira (conhecida como %K) representa o movimento do preço, enquanto a segunda (conhecida como %D) é um média móvel da primeira linha. Se o preço de fechamento for superior à mediana da faixa alta/baixa, o SMI retorna um valor positivo. Se o preço de fechamento for inferior ao preço médio, um valor negativo é retornado. Valores acima de 40 indicam tendência de alta, enquanto valores abaixo de -40 indicam tendência de baixa.","Themes":"Temas","There are no favorites yet.":"Ainda não há favoritos.","tick":"tique-taque","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"Intervalo de tique-taque disponível apenas para o tipo de Gráfico \\\\\\"Area\\\\\\".","Time interval":"Intervalo de tempo","Trend":"","Trend [num]":"Trend [num]","Try checking your spelling or use a different term":"Tente verificar a ortografia ou use um termo diferente","Underlying Assets":"Ativos subjacentes","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"São permitidos até 5 indicadores ativos.","Vertical [num]":"Vertical [num]","Volatility":"","Would you like to overwrite it?":"Deseja substituí-lo?","You have no active drawings yet.":"Você ainda não tem nenhum indicador.","You have no active indicators yet.":"Você ainda não tem nenhum indicador.","You have no saved templates yet.":"Você ainda não tem modelos salvos.","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig Zag ajuda a identificar reversões de tendência e filtra movimentos de preços relativamente pequenos, determinando os níveis de suporte e resistência do mercado. Ele aceita uma porcentagem de desvio como entrada e exibe uma linha se a mudança de preço for maior do que a porcentagem de desvio. O Zig Zag ignora qualquer movimento lateral e é útil para filtrar o “ruído do mercado”.","Zoom in":"Aumentar o zoom","Zoom out":"Diminuir o zoom"}')}}]);
